/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div		class="ui5-datepicker-root"		style="${styleMap(context.styles.main)}"		@keydown=${context._onkeydown}><!-- INPUT --><ui5-input			id="${ifDefined(context._id)}-inner"			class="ui5-datepicker-input"			placeholder="${ifDefined(context._placeholder)}"			type="${ifDefined(context.type)}"			value="${ifDefined(context.value)}"			?disabled="${context.disabled}"			?readonly="${context.readonly}"			value-state="${ifDefined(context.valueState)}"			@ui5-change="${ifDefined(context._handleInputChange)}"			@ui5-input="${ifDefined(context._handleInputLiveChange)}"			data-sap-focus-ref			._inputAccInfo ="${ifDefined(context.accInfo)}"	>		${ !context.readonly ? block1(context) : undefined }</ui5-input><slot name="formSupport"></slot></div>`; };
const block1 = (context) => { return html`<ui5-icon				slot="icon"				name="${ifDefined(context.openIconName)}"				tabindex="-1"				accessible-name="${ifDefined(context.openIconTitle)}"				show-tooltip				@click="${context.togglePicker}"				input-icon				?pressed="${context._isPickerOpen}"				dir="${ifDefined(context.dir)}"			></ui5-icon>		`; };

export default block0;
